import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        {/* Logo à gauche */}
        <Link to="/" className="navbar-brand">
          <img src="logo.png" alt="Logo" className="logo" />
        </Link>

        {/* Bouton de menu pour les écrans mobiles */}
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Liens de navigation alignés à droite */}
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav gap-4">
            <li className="nav-item">
              <Link to="/" className="nav-link text-white fs-5">Accueil</Link>
            </li>
            <li className="nav-item">
              <Link to="/materiels" className="nav-link text-white fs-5">Remorques</Link>
            </li>
            <li className="nav-item">
              <Link to="/devis" className="btn btn-primary px-4 py-2">Devis</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
